import "../App.css";
import 'bootstrap/dist/css/bootstrap.min.css';
import React, { useState } from "react";
import Header from "../components/Header";

function QueueStatus() {
    return <div className="queueStatus">
        <Header />
        <div className="bookingCard">
            <img src={require("../img/calendar.png")} className="confirmationTick"></img>
            <p className="bookingHeading">Queue Status: In Queue</p>
            <p>Your doctor's appointment for 2.00PM has been confirmed.</p>
            <p>Please head down to the clinic 15 minutes before your appointment. Your slot will be forfeited if you are not here 5 minutes after the start time.</p>
        </div>
    </div>
}

export default QueueStatus;
